INSERT INTO `specialties` (`id`, `unique_code`, `user_id`, `specialty`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'SPETY000001', 3, 'anesthetics', 'contrary to popular belief lorem ipsum is not simply random text it has roots in a piece of classical latin literature from 45 bc making it over 2000 years old richard mcclintock a latin professor at hampden sydney college in virginia looked up one of the more obscure latin words consectetur from a lorem ipsum passage and going through the cites of the word in classical literature discovered the undoubtable source ', '1', '2021-09-09 23:26:34', '2021-09-09 23:26:34', NULL),
(2, 'SPETY000002', 3, 'emergency medicine', 'there are many variations of passages of lorem ipsum available but the majority have suffered alteration in some form by injected humour or randomised words which don t look even slightly believable if you are going to use a passage of lorem ipsum you need to be sure there isn t anything embarrassing hidden in the middle of text ', '1', '2021-09-09 23:26:57', '2021-09-09 23:26:57', NULL),
(3, 'SPETY000003', 3, 'general practice', 'all the lorem ipsum generators on the internet tend to repeat predefined chunks as necessary making this the first true generator on the internet it uses a dictionary of over 200 latin words combined with a handful of model sentence structures to generate lorem ipsum which looks reasonable the generated lorem ipsum is therefore always free from repetition injected humour or non characteristic words etc ', '1', '2021-09-09 23:27:18', '2021-09-09 23:27:18', NULL),
(4, 'SPETY000004', 3, 'intensive care', 'the standard chunk of lorem ipsum used since the 1500s is reproduced below for those interested sections 1 10 32 and 1 10 33 from de finibus bonorum et malorum by cicero are also reproduced in their exact original form accompanied by english versions from the 1914 translation by h rackham ', '1', '2021-09-09 23:27:40', '2021-09-09 23:27:40', NULL),
(5, 'SPETY000005', 3, 'medicine', 'lorem ipsum dolor sit amet consectetur adipiscing elit sed do eiusmod tempor incididunt ut labore et dolore magna aliqua ut enim ad minim veniam quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur excepteur sint occaecat cupidatat non proident sunt in culpa qui officia deserunt mollit anim id est laborum ', '1', '2021-09-09 23:28:02', '2021-09-09 23:28:02', NULL),
(6, 'SPETY000006', 3, 'obtetrics gyneacology', 'sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium totam rem aperiam eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo ', '1', '2021-09-09 23:28:24', '2021-09-09 23:28:24', NULL),
(7, 'SPETY000007', 3, 'pathologist', 'at vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident similique sunt in culpa qui officia deserunt mollitia animi id est laborum et dolorum fuga ', '1', '2021-09-09 23:28:44', '2021-09-09 23:28:44', NULL),
(8, 'SPETY000008', 3, 'peadiatrics', 'on the other hand we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment so blinded by desire that they cannot foresee the pain and trouble that are bound to ensue and equal blame belongs to those who fail in their duty through weakness of will which is the same as saying through shrinking from toil and pain ', '1', '2021-09-09 23:29:09', '2021-09-09 23:29:09', NULL),
(9, 'SPETY000009', 3, 'psychiatry', 'in a free hour when our power of choice is untrammelled and when nothing prevents our being able to do what we like best every pleasure is to be welcomed and every pain avoided ', '1', '2021-09-09 23:29:34', '2021-09-09 23:29:34', NULL),
(10, 'SPETY0000010', 3, 'Radiology', 'but in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted the wise man therefore always holds in these matters to this principle of selection he rejects pleasures to secure other greater pleasures or else he endures pains to avoid worse pains ', '1', '2021-09-09 23:29:57', '2021-10-07 03:17:57', NULL),
(11, 'SPETY0000011', 3, 'Surgery', 'et harum quidem rerum facilis est et expedita distinctio nam libero tempore cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus omnis voluptas assumenda est omnis dolor repellendus temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae ', '1', '2021-09-09 23:30:16', '2021-10-07 03:15:43', NULL);
